t','poor course. never give any algorithm. No clue where the problem come from. The forum is only help a few people. No general ideas how to solve the problem. waist a lot of time debugging but still couldn\'t pass the assignment.total waste my time and garbage course.',6,9764882015,'NEGATIVE'),(274,'2020-04-25','18:02:28','Java','While I like the content of the course but I felt too much of topics were crammed into one single course. I had to struggle a lot to grasp the concepts on advanced algorithms by just relying on video lectures so I had to look around in the internet for additional resources. Nonetheless it was a satisfying experience though it took me a lot of time and effort to complete the assignments.',6,7385114639,'NEGATIVE'),(275,'2020-04-25','18:02:30','C++','Inadequate student and teacher participation on forums, leaving students to figure things out without assistance or collaboration. Insufficient explanation of math concepts required to fully understand lectures.',6,9823597759,'NEGATIVE'),(276,'2020-04-25','18:02:32','Python','The problems are really challenging, thank you! However, the instructor is not very active in the discussion forum, which is a pity when you really need help and get stucked in the problem set.',6,9423326464,'NEGATIVE'),(277,'2020-04-25','18:02:34','Python','Horrible, endless rambling, no solutions to the quiz questions (unlike cal 1 course). sucks all the fun out of math, avoid this course, find an alternative where you can learn more with less time spent watching him write out 20 numbers.',6,9175112122,'NEGATIVE'),(278,'2020-04-25','18:02:36','C#','Bad teaching quality.',6,7709443788,'NEGATIVE'),(279,'2020-04-25','18:02:38','Python','Honestly, for something that says \"Advanced\" in the title, I thought it was a little too basic. There isn\'t enough depth and a lot of it involves common sense. Perhaps a more case-study driven course would have been interesting with more qualitative, essay responses required rather than cut-and-dry multiple-choice.',6,9422554528,'NEGATIVE'),(280,'2020-04-25','18:02:40','Python','content was not as interesting as in the first course, but still good overall. Questions were also less analytical challenging as the first course. But I still enjoyed the course as the professor was explaining the subject clearly and the videos were compact and enjoyable.',6,9767949541,'NEGATIVE'),(281,'2020-04-25','18:02:42','C++','This course is not only well structured, but truly enjoyable with the various outdoor background',6,9890072825,'NEGATIVE'),(282,'2020-04-25','18:02:44','Python','It was a great course, however some of the quiz answers are debatable',6,8390846658,'POSITIVE'),(283,'2020-04-25','18:02:46','Java','After completing this course, I have gained valuable insights in real life situations and be more aware in my own industry. This course would not only allow you to see the playing field but also to make carefully calculated decisions towards the best possible outcome.The tests are difficult and some are rather tricky. But hey, the situations we encounter in real life are far worse than these.',6,9766913178,'POSITIVE'),(284,'2020-04-25','18:02:48','C++','Material was tough, some of the questions weren\'t easy to understand / process. But overall a great class.',6,9405232969,'POSITIVE'),(285,'2020-04-25','18:02:50','C#','Extremely poor quality of instruction. The lectures themselves are little more than the material being read directly off the slides by an individual with a poor grasp on the English language. The majority of the slides are walls of unclear and non-descriptive text. Even with reading directly from the slides, the lecturer is overly circumstantial in her explanations if not just outright tangential. I commend the authors for putting together a course outside of their native language but, in this case at least, it does more harm than good.In short, this course has the air of a group of first year students giving a presentation verbatim from the slides, as another commenter also mentioned below.',6,7666269087,'NEGATIVE'),(286,'2020-04-25','18:02:52','Python','This course is a discreditation to coursera, and it\'s low standards are appalling. From a purely certificate based perspective, the only requirement to complete the course are completely the quizzes. They are short, and can easily be googled, or the slides can be downloaded and the answers simply CRTL+F for keyboards. There is zero need to watch the lectures ( at least for the first 2 weeks).The lectures are terrible themselves. The English is beyond horrible, and I don\'t understand the modern culture of having teachers teach in languages they can\'t speak. It is purely reading off the slides in any case, word for word. I learned more about the basics in neuroscience in a 20 minutes lecture from a separate course, \"Computational Neuroscience\" than the entire first week here.If you actually want to learn neuroscience, check out HardvardX\'s intro course.',6,9096703149,'NEGATIVE'),(287,'2020-04-25','18:02:54','.Net','This is the worst, most pathetic course I have taken online. If Peking University believes this is their best - I\'ll not be taking another course with them. The instructor\'s command of the English language is awful and the sub-titles are some help, but not a lot. Instructors are just talking faces up front - they cannot teach. They may be great in the lab, but keep them out of the classroom. I toughed out the course, but it only got worse. I had originally signed up for parts 1 and 2 of this course. Canceled part 2. The use of slides that are not clear / too small and not on the screen long enough to digest the information did not help. Do yourself a favor - avoid this course. As a side note - I have taken in excess of 25 online courses, this was the most painful.',6,9403541701,'NEGATIVE'),(288,'2020-04-25','18:02:56','.Net','Very good Course!! Thank You.',6,8087646513,'POSITIVE'),(289,'2020-04-25','18:02:58','Python','Very boring... The professor is just reading (with a bad English). The illustrations are also very boring...',6,9503386115,'NEGATIVE'),(290,'2020-04-25','18:03:00','C++','The professor is reading long texts. It is not really attractive.',6,9423353359,'NEGATIVE'),(291,'2020-04-25','18:03:02','Java','I greatly enjoyed the material presented in this course and while I do not doubt the proficiency of it\'s creators the poor standard of spoken English of its two main presenters prevents me from recommending it to colleagues. As another reviewer has remarked, their English may be quite sufficient for day to day use with other experts but for inadequate for teaching students who are hearing many technical terms for the first time. The transcripts are no better and also contain many mistakes. I believe that this course should be stopped until these problems are corrected.',6,8657186194,'POSITIVE'),(292,'2020-04-25','18:03:04','C#','nice course. learned quite a bit.',6,9579888602,'POSITIVE'),(293,'2020-04-25','18:03:06','Python','The professors sound like a group of first-year students presenting a group project, literally reading notes off of a powerpoint slide. The professors also can\'t speak English, so instead of explaining things in depth, they have to very, very slowly read basic phrases (to explain complex subject matter) off of what\'s basically a teleprompter.',6,8888609916,'POSITIVE'),(294,'2020-04-25','18:03:08','Python','So far the topics are very interesting but the accent of the teacher is sooo difficult to follow and distracts me! Also, she is looking down to read all the time and this doesn\'t reflect her knowledge.',6,9028705775,'POSITIVE'),(295,'2020-04-25','18:03:10','.Net','Really poor powerpoint presentations and videos, half in chinese. The accent of the teacher is horrible (i\'m not an english-native speaking person so it\'s hard for me to follow english when badly spoken, so i cut off the sound and only read the subtitles.)The content is interesting though.',6,8983050536,'NEGATIVE'),(296,'2020-04-25','18:03:12','C#','I don\'t want to be mean, but the first week was terrible! I was expecting what it said: ADVANCED neurobiology.I feel bad giving this review. I\'m just dropping the course.',6,9960480480,'NEGATIVE'),(297,'2020-04-25','18:03:14','C++','This course is useless and perhaps even harmful.The professors would have done much better if they had taught the class in their native Chinese language and then got a really good translator to make subtitles in English.I tried turning off the sound and just watching the presentation while reading the subtitles, but even this was so badly done in terms of language and presentation, that although I desperately wanted to take a course in advanced neurobiology, I felt that this course could actually destroy my love for the subject or teach me things that are incorrect because of language mistakes.If you are not a native speaker of English then by all means steer even further clear as you will learn some very bad English habits and pronunciation.I\'m sure the profs\' English ability is fine for collaborating with other professionals who already know the material, but teaching in English was a big mistake.Again, I highly suggest they re-do the entire thing in Chinese and get really good translations and subtitles made and then I think it could be an awesome course. Now, as is, it would be truly foolish to take this course.',6,7588052777,'NEGATIVE'),(301,'2020-04-25','18:37:00','Java','Great mental workout. Well-explained, but the coding challenges and bonus questions are challenging enough to allow for a lot of growth even for more advanced students.',7,8087817032,'POSITIVE'),(302,'2020-04-25','18:37:00','Java','As someone with only (UK) high school level maths I just about managed to follow this. I am still confused by logarithms. I guess I should go and read the maths for computer science resource.',7,7767987295,'POSITIVE'),(303,'2020-04-25','18:37:00','C','I had a great time taking this