bably because I struggle with stats.',7,9860443514,'POSITIVE'),(321,'2020-04-25','18:37:00','C++','A very nice course!',7,9960333559,'POSITIVE'),(322,'2020-04-25','18:37:00','Python','I was glad to get exposure to famous algorithms through this class, but I don\'t feel like I really developed an intuition for reasoning about their runtime. The class was challenging, but mostly for the wrong reasons. I spent more time and energy pouring over the answers to tricky quizzes and having to implement algorithms exactly as described in the lecture notes rather than really truly learning. It also took me much longer than the 4-8 hours per week advertised to complete each week.',7,7875943166,'POSITIVE'),(323,'2020-04-25','18:37:00','C++','Thank you so much! I grown so much in the field of Algorithms because of this course. Onto the next one.',7,9765690132,'POSITIVE'),(324,'2020-04-25','18:37:00','C++','Liked the style and intensity of the course!',7,9922321839,'POSITIVE'),(325,'2020-04-25','18:37:00','C','This is a best algorithm course I have ever done!',7,9689062259,'POSITIVE'),(326,'2020-04-25','18:37:00','Java','Excellent course',7,9545855410,'POSITIVE'),(327,'2020-04-25','18:37:00','Java','The instructor for this course is absolutely excellent. He is a master of the subject and explains the material to get at the concepts behind it rather than just a superficial understanding. He also does not get lost in mathematical notation, explaining clearly what each piece of the math he is showing us means.',7,8888307888,'POSITIVE'),(328,'2020-04-25','18:39:00','C++','Very good course !',7,8237434255,'POSITIVE'),(329,'2020-04-25','18:39:00','C','It\'s an amazing introduction to algorithms. I enjoyed listening to the lectures. All the algorithms were explained in detail.',7,9028145004,'POSITIVE'),(330,'2020-04-25','18:39:00','Java','The course was quite useful and enlightening was a good start to learn algorithms!',7,9762391056,'POSITIVE'),(331,'2020-04-25','18:39:00','Java','aweso