POSITIVE'),(340,'2020-04-25','18:39:00','C++','Challenging but Insightful. Definitely worth it.',7,9762250097,'POSITIVE'),(341,'2020-04-25','18:39:00','C','This course offers one of the best introductions to reasoning about algorithms in a mathematical way. However, it is not just theory, it also gives you practical advise and forces you to polish up your programming skills as well by implementing some of the most useful and popular algorithms for sorting and similar applications in whatever language you wish.',7,9922038402,'POSITIVE'),(342,'2020-04-25','18:39:00','Java','Excellent course. What I valued most about this course was the clarity with which proofs and algorithms are explained. In learning algorithms one really profits from a great professor. Keep in mind that this course involves mathematics for proofs and I believe one has to be really curious about algorithms and dive into proofs to take full advantage of this course. Regarding assignments they are challenging but definitely approachable if you have some experience in programming. My advice: do not get discouraged, this is all about resilience!',7,2025396595,'POSITIVE'),(343,'2020-04-25','18:39:00','Java','Excellent course! I would recommend it to everyone who wants to learn algorithms.',7,9889573366,'POSITIVE'),(344,'2020-04-25','18:39:00','C++','Awesome,right now I know why algorithms are most important..!!',7,9403188499,'POSITIVE'),(345,'2020-04-25','18:39:00','C++','Tim gives great insights and draws attention to the right things at right time! Exercise and quizzes are very helpful and makes you think in right direction. Also the in-video-quizzes are well thought of to make you think about the topic being described in the video and thus makes it easy to understand the contents. This is just the right course anyone should take to improve/learn algorithm and data structures course. I\'ve got got aaha! moments multiple times. Can\'t thank Tim enough!!',7,9689014884,'POSITIVE'),(346,'2020-04-25','18:39:00','C++','Sir Tim Roughgarden teaches very straight forward and easy .I like the course.',7,9370866979,'POSITIVE'),(347,'2020-04-25','18:39:00','Python','Cool class',7,8625849270,'POSITIVE'),(348,'2020-04-25','18:39:00','C++','Exceptional materials and teacher.',7,9527040093,'POSITIVE'),(349,'2020-04-25','18:39:00','C++','Great. Enjoyed the session',7,9689513180,'POSITIVE'),(350,'2020-04-25','18:39:00','C++','Challenging and fun!',7,8390716026,'POSITIVE'),(351,'2020-04-25','18:39:00','Java','Helpfull.',7,9049006101,'POSITIVE'),(352,'2020-04-25','18:39:00','Java','Amazing course!',7,9405022036,'POSITIVE'),(353,'2020-04-25','18:39:00','C++','The unique value of taking the course: read and think through the material with guidance and completing its assignments is the efficiency by saving all the search cost would I collect on my own the good and succinct presentation of the knowledge and exercises with solutions (at least correctness checks.) The entire detail of an algorithm is hard to keep afresh in memory and one needs to refresh it from time to time. It is very cost-effective to take a course like this to accelerate the refresh.',7,9665304472,'POSITIVE'),(354,'2020-04-25','18:39:00','Java','Very good course on algorithms, a lot of terms explained in details with exercises',7,7276137563,'POSITIVE'),(355,'2020-04-25','18:39:00','Java','Well structured, well explained. Great course!',7,9823467201,'POSITIVE'),(356,'2020-04-25','18:39:00','C','Very nice course !!',7,9028731284,'POSITIVE'),(357,'2020-04-25','18:40:00','Java','This is a great course for who doesn\'t have a computer science background!',7,8087416529,'POSITIVE'),(358,'2020-04-25','18:40:00','Java','This course has some great quiz questions. I\'d recommend it to people just for them.',7,9689082463,'POSITIVE'),(359,'2020-04-25','18:40:00','C','The math in this course is quite difficult, but the professor does a great job of explaining it in a very easily understood way.',7,9921229659,'POSITIVE'),(360,'2020-