 it will go unresolved or be worsened by potentially wrong answers from other students which I saw happen many, many times. Maybe I am expecting too much from an online learning platform? In all, I feel like while I did learn, I perhaps learned some wrong practices too. So while the videos are great, the actual teacher involvement is poor.Coursera - I am not sure how you and the university work together, but is it totally strange to desire some input from your professor?',10,9850421712,'POSITIVE'),(655,'2020-04-25','20:21:19','MATLAB','Best course of the specialization so far, you can tell the instructor specializes in engaging presentations. I felt like I was never lost, but always challenged.',10,9766511525,'POSITIVE'),(656,'2020-04-25','20:21:25','Java','Great course and extremely helpful professor! Love it!',10,9768898846,'POSITIVE'),(657,'2020-04-25','20:21:29','Python','Nice Course',10,8446882070,'POSITIVE'),(658,'2020-04-25','20:21:30','R','Great course!',10,8552018760,'POSITIVE'),(659,'2020-04-25','20:21:36','Python','excellent',10,8308172142,'POSITIVE'),(660,'2020-04-25','20:21:42','MATLAB','Great Course highly recommended!',10,9890167919,'POSITIVE'),(661,'2020-04-25','20:21:48','MATLAB','Great work!!',10,9403956704,'POSITIVE'),(662,'2020-04-25','20:21:52','Python','The course was well built-up, the presentations were extremely clear and there was a great combination between listening and actual examples that you had to do yourself.',10,9833883245,'POSITIVE'),(663,'2020-04-25','20:21:59','R','Awesome course. Easy to understand and useful tools. Thank you so much for providing me this course! :)',10,9673276999,'POSITIVE'),(664,'2020-04-25','20:24:00','R','Thanks very much for great content and especially, Ms. Jana Schaich Borg for brilliant presentation skills, lovely voice and good looking as well. Please participate. This is highly recommend course.',10,8007791921,'POSITIVE'),(665,'2020-04-25','20:24:02','Java','I enjoyed learning this course. It\'s not only fun but also gives very detailed tutorial by using Tableau. This course gives me a practical learning experience and business orientated way of thinking by utilizing the Data Visualization.',10,9503111805,'POSITIVE'),(666,'2020-04-25','20:24:06','MATLAB','The flow and presentation was very engaging. This will give you a relatively basic overview of tableau with mention of higher functionality. \"Poking the box\" is going to be a lot easier having taken this course.',10,9822863589,'POSITIVE'),(667,'2020-04-25','20:24:15','Python','Interesting and useful so far',10,9175688959,'POSITIVE'),(668,'2020-04-25','20:24:18','R','Very engaging!',10,9049416941,'POSITIVE'),(669,'2020-04-25','20:24:21','Java','excellent',10,8605803396,'POSITIVE'),(670,'2020-04-25','20:24:26','R','Very good course',10,8390597136,'POSITIVE'),(671,'2020-04-25','20:24:35','Python','Loved the Tableau section and the instructor is a good communicator. It\'d be great to have a whole course about this BI Software',10,9673695163,'POSITIVE'),(672,'2020-04-25','20:24:38','Python','Excelent',10,9403359360,'POSITIVE'),(673,'2020-04-25','20:24:40','Java','This is an excellent course. You are given a six month license to use Tableau as well as practice data for the assignments and exercises. It is very practical and informative. It covers more than just Tableau. The first week is about framing data questions and working with stakeholders. The second and third week cover Tableau. The last week gives some very helpful tips for giving effective presentations. The final assessment will go over all of these things, so be prepared to put them to use if you want the final certificate.',10,7218773462,'POSITIVE'),(674,'2020-04-25','20:24:42','MATLAB','You will be impress about how this course . Yo will enjoy high level of Educational Material .',10,8793803137,'POSITIVE'),(675,'2020-04-25','20:24:49','Java','Absolutely outstanding course. It stretched me - late nights grappling with the data, learning Tableau, recording a blooper-free presentation. So many takes!But this course was not just about Tableau; it was about clarifying goals, planning before diving into the data, putting yourself in the shoes of the client and good presentation principles. Great practical exercise at the end - make sure you put aside plenty of time for this.',10,9403587411,'POSITIVE'),(676,'2020-04-25','20:24:53','Java','wonderful design of content, good business examples.',10,7972103980,'POSITIVE'),(677,'2020-04-25','20:24:59','R','Very interesting and very useful course',10,9404584018,'POSITIVE'),(678,'2020-04-25','20:32:04','Python','Wonderful class',10,8983276232,'POSITIVE'),(679,'2020-04-25','20:32:06','R','The title is very misleading. Excel is an afterthought for this course; instead there is a heavy focus on statistics. The class claims to be for beginners, but that is clearly not the case, as it requires previous knowledge in inferential statistics and calculus.Excel is hardly used and is certainly not the focus; there are weeks where Excel is not used at all. There are no practice assignments, only quizzes.It\'s clear that this course is outdated and poorly maintained, as the videos refer to examples that are not included or content that was not presented.Needless to say, I will not be taking any other courses in this specialization.',10,8483818554,'NEGATIVE'),(680,'2020-04-25','20:32:12','MATLAB','This class required far too much independent study. The instructor did not provide enough instruction or reading material to complete the quiz each week. There was too much focus on the conceptual data with very little emphasis on practical application of the material.',10,8975668625,'NEGATIVE'),(681,'2020-04-25','20:32:18','Java','Not enough practices for the unexperienced students.',10,7798577001,'NEGATIVE'),(682,'2020-04-25','20:32:20','Java','I am sorry to say this, but the tutorial could have been organzied in a much more serious way.I do not know how much time the Professors have put on preparation. But it gives me a \"sloppy\" impression!!! The class carries the name of University of Duke and 70 euros are charged, so I think the learners would reasonably expect to see that the teacher puts lots of time to organize the course structure, in order to efficiently give as much as information to the learners within limited time!For example, I believe nobody would not say that the Week 2 content on confusion matrix is very consistently explained. And this is just one example.',10,8551084088,'NEGATIVE'),(683,'2020-04-25','20:32:26','Python','Content is not well organized, videos are disconnected from one another, explanations are not clear, spreadsheets contain vast information that is not explained anywhere. It is been quite difficult to follow through the course and I bet many students are giving up.',10,9922935153,'NEGATIVE'),(684,'2020-04-25','20:32:32','Java','This course contains too few solid content.',10,7875393459,'NEGATIVE'),(685,'2020-04-25','20:32:36','R','This is definitely not a course for beginners .',10,9049393788,'NEGATIVE'),(686,'2020-04-25','20:32:43','R','Does not teach Excel very well while tryng to apply the basic usage instruction to not too difficult problems. The ability to interface with Excel after some knowledge of Python/R or other programming languages would be helpful in the Data Science programming that is increasingly being promoted.',10,8983007372,'NEGATIVE'),(687,'2020-04-25','20:32:56','MATLAB','Way too theoretical. This is Excel, not Information Theory....',10,9822825658,'NEGATIVE'),(688,'2020-04-25','20:40:00','MATLAB','This course was over my head academically and I was able to glean very little from it.',10,8007581592,'NEGATIVE'),(689,'2020-04-25','20:40:05','Java','Too advanced, not enough Excel',10,9765961309,'NEGATIVE'),(690,'2020-04-25','20:40:10','Python','Not so relevant with real work.',10,8412060671,'NEGATIVE'),(691,'2020-04-25','20:40:15','R','Probably the worst class I have ever taken on Coursera. The teacher a