 to study Excel at length before trying the course again. Why not label it as an intermediate or higher class? I feel there should be a more obvious indication of the difficulty.',11,9881566755,'NEGATIVE'),(783,'2020-04-26','09:32:28','C++','absolutely one of the worst courses... I am deleting it from my list.no slides make it harder to follow.',11,9823563996,'NEGATIVE'),(784,'2020-04-26','09:32:30','Python','Too much material, that moved too fast. Wasn\'t opportunity for enough feedback and explanation. I',11,9175555572,'NEGATIVE'),(785,'2020-04-26','09:32:32','Java','It has a lot of problems, including: Not so many lectures about excel itself - most of the time you will be watching videos about statistic methods. The lectures are very superficial, even though the quizzes and projects demand a lot of knowledge and time. The course seems to have a staff of one man: the professor of the course rarely replies (even though he did at the beginning of the session) and all the work seems to be done by his assistant, who tries his best, but ends up not coping with all the questions asked at the discussion forums.',11,7276818942,'NEGATIVE'),(786,'2020-04-26','09:32:34','Python','It will be better adding examples related with engineering cases (this is for technical people in any branch of engineering).',11,8485022115,'NEGATIVE'),(787,'2020-04-26','09:32:36','Java','it is too complicated for me this courese, not very useful for daily work. but anyway i',11,7875919101,'NEGATIVE'),(788,'2020-04-26','09:32:38','Java','Way too many abstract concepts that are not relevant to the challenges that I encounter in my day-to-day role. I wish this course would actually show me how to solve PRACTICAL business problems.The 2nd part of the course is not enjoyable at all. Sorry.',11,9822092135,'NEGATIVE'),(789,'2020-04-26','09:32:40','Python','The  course materials and videos are not so helpful. Some topics are run through so quickly that they are confusing to students.',11,7038340022,'NEGA