ialization so this Excel class and the final project seem to be an utter waste of money without me going off to study Excel at length before trying the course again. Why not label it as an intermediate or higher class? I feel there should be a more obvious indication of the difficulty.',11,8888799646,'NEGATIVE'),(800,'2020-04-26','09:33:02','.Net','absolutely one of the worst courses... I am deleting it from my list.no slides make it harder to follow.',11,9823255887,'NEGATIVE'),(801,'2020-04-26','09:33:04','Java','Too much material, that moved too fast. Wasn\'t opportunity for enough feedback and explanation. I',11,8149460346,'NEGATIVE'),(802,'2020-04-26','09:33:06','C++','It has a lot of problems, including: Not so many lectures about excel itself - most of the time you will be watching videos about statistic methods. The lectures are very superficial, even though the quizzes and projects demand a lot of knowledge and time. The course seems to have a staff of one man: the professor of the course rarely replies (even though he did at the beginning of the session) and all the work seems to be done by his assistant, who tries his best, but ends up not coping with all the questions asked at the discussion forums.',11,9762271830,'NEGATIVE'),(803,'2020-04-26','09:33:08','Python','It will be better adding examples related with engineering cases (this is for technical people in any branch of engineering).',11,8805450107,'NEGATIVE'),(804,'2020-04-26','09:33:10','Java','it is too complicated for me this courese, not very useful for daily work. but anyway i',11,9673250532,'NEGATIVE'),(805,'2020-04-26','09:33:12','Java','Way too many abstract concepts that are not relevant to the challenges that I encounter in my day-to-day role. I wish this course would actually show me how to solve PRACTICAL business problems.The 2nd part of the course is not enjoyable at all. Sorry.',11,9766885853,'NEGATIVE'),(806,'2020-04-26','09:33:14','Java','The  course materials and videos are not so helpful. Some topics are run through so quickly that they are confusing to students.',11,9421838190,'NEGATIVE'),(807,'2020-04-26','09:33:16','Python','Overall, the course is great except for some minor inconvenience of the lecture. Some concepts are not carefully explain like incidence etc',11,9404552522,'NEGATIVE'),(808,'2020-04-26','09:33:18','.Net','Perfect course!',11,9766428540,'POSITIVE'),(809,'2020-04-26','09:33:20','Java','More worksheets and examples would help :) the course is quite dense in terms of the number of topics covered',11,9665495837,'NEGATIVE'),(810,'2020-04-26','09:33:22','C++','A bit very difficult course...full of formula',11,7588184400,'NEGATIVE');
